            "rek_title": "Network interactions allowing myosin II to feedback to RhoA: sequencing, predictive modelling, and experimentation",
            "rek_description": "8 x supplementary figures; 2 x supplementary table; 3 x videos, supplementary note<br /><br />Supplementary Figure 1 Myosin II supports a stable Rho zone at the ZA<br /><br />Supplementary Figure 2 p190B RhoGAP degrades the junctional Rho zone when NMII is inactivated<br /><br />Supplementary Figure 3 Rnd3 recruits p190B to the ZA when NMII is inhibited<br /><br />Supplementary Figure 4 ROCK-1 phosphorylates Rnd3 to support junctional Rho signaling<br /><br />Supplementary Figure 5 Myosin II scaffolds ROCK-1 at the epithelial Zonula Adherens<br /><br />Supplementary Figure 6 Bistable properties of RhoA localization at cell-cell junctions<br /><br />Supplementary Figure 7 Bright field/DIC images corresponding to Figures 1a, 1f, 2h, 3a, 3b, 5h and supplementary figures 1c, 1e, 4e<br /><br />Supplementary Figure 8 Uncropped western blots<br /><br />Supplementary Table 1 Sequences of siRNA and primers used for the study<br /><br />Supplementary Table 2 Statistical Source data<br /><br /><strong>Supplementary Video 1</strong><br />GFP-AHPH localizes at the zonula adherens of epithelial cells.<br />Z-stacks of GFP-AHPH and RFP-UtrCH acquired by spinning disc confocal microscopy.<br /><br /><strong>Supplementary Video 2</strong><br />GFP-AHPH exhibits stability on the time scale of minutes.<br /> Time-lapse imaging of GFP-APHPH (transfected in MCF-7 cells) acquired over a span of 30 minutes.<br /><br /><strong>Supplementary Video 3</strong><br />ROCK-1 inhibition causes accumulation of p190B Rho GAP at the cell-cell junctions.<br />MCF-7 cells were transfected with GFP-p190B RhoGAP and time-lapsed imaging was performed briefly before and after addition of Y-27632 (30 &mu;M)<br />(20-minutes post-treatment).<br /><br /><strong>Supplementary Notes include</strong>:<br /><em>Experimental foundations of the model.</em><br />Computational model.<br />Supplementary Note Table 1. Hill (K), maximal association rates (b) and decay (a) <br />constants in the stimulation repression model shown in Scheme 1. <br /><em><br />Implications of the one dimensional model</em><br />Effect of removing feedback from ROCK1 to RhoA.<br />Supplementary Note Table 2. Kinetic equations for the reduced subsystem shown <br />in Scheme 2.<br />Effect of removing feedback from NMIIA to ROCK1.<br />Effect of adding negative feedback from Rnd3 to ROCK1.<br /><br /><em>Extension of the stimulation/repression model to 3 dimensions</em><br />Derivation of the explicit form for the equations used in the spatial model.<br />Supplementary Note Table 3. Kinetic equations for the stimulation repression model in 3 dimensions<br />Supplementary Note Table 4. Steady state cortical concentrations of the different species in the 3<br />dimensional model<br />Supplementary Note Table 5. Variable transformation between the one dimensional stimulation repression model and its extension in 3 dimensions.<br />Numerical simulations for the 3 dimensional model.<br />Supplementary Note Table 6. Dissociation rates, binding affinities and activation constants used for modeling in three dimensions <br />Supplementary Note Table 7. Initial concentrations and diffusion coefficients of species in the 3 - dimensional modelling.<br /><br />Implications of the model for cortical signaling at the ZA.<br /><br />Supplementary Note Table 6. Dissociation rates, binding affinities and activation constants used for modeling in three dimensions <br />Supplementary Note Table 7. Initial concentrations and diffusion coefficients of species in the 3 - dimensional modelling.<br /><br /><em>Implications of the model for cortical signaling at the ZA.</em><br /><br />",
